import React from 'react'
// import Card from './Card';

export default function CardList(props) {
  console.log(props.users);
  const {users} = props;
  return (
    <div>
    {users.map(user => (
      <div>
       {user.name}
       {user.about}
       {user.age}
      </div>
    ))}
    </div>
  )
}
